count_l = 0
count_i = 0
count_a = 0 
@base.each do |d|
  w = Song.new
  w.title = d[0]
  w.artist = d[1]['artist']
  if d[1]['lyrics']
  w.lyrics = d[1]['lyrics']
  else
  puts "no lyrics"
  count_l = count_l+1
  end
  w.lastfm_url = d[1]['lfm_url']
  if d[1]['imgs']
  w.img_s = d[1]['imgs'][0]
  w.img_m = d[1]['imgs'][1]
  else
  puts "no image"
  count_i = count_i+1
  end
  arr_video = []
  arr_video << d[1]['off_vid']
  w.video_yt = arr_video
  arr_audio = []
  if d[1]['audio']
  d[1]['audio'].each do |ddd|
    arr_audio << ddd
  end
  else
  puts "no audio found "
  count_a = count_a+1
  end
  w.audio_sc = arr_audio
  w.save
  puts w.title
end
puts "no audio in "+count_a.to_s
puts "no lyrics in "+count_l.to_s
puts "no image in "+count_i.to_s

